import React from 'react';
import './login.css';
import { useNavigate } from 'react-router-dom';

export const Login = () => {
    const navigate = useNavigate();

    return (
        <div className="container">
            <h2>Login Page</h2>
            <form className="form">
                <input
                    className="input"
                    type="text"
                    placeholder="enter name"
                />
                <input
                    className="input password"
                    type="password"
                    placeholder="enter password"
                />
                <button
                    className="sbutton"
                    onClick={() => navigate('/')}
                    type="submit"
                >
                    Submit
                </button>
            </form>
        </div>
    );
};
